ne is a modern WordPress blog theme created especially for personal blogging and portfolio showcase. It encourages freelancer to share their experiences to the world.</desc>\n            <img>https://solwincdn-79e1.kxcdn.com/wp-content/uploads/2018/01/Mine-Responsive-WordPress-Theme.png</img>\n            <link>https://www.solwininfotech.com/product/wordpress-themes/mine/</link>\n        </mine>\n        <bloggers_lite>\n            <name>Bloggers Lite</name>\n            <desc>Bloggers Lite is a simple and easy to use responsive WordPress theme free for personal bloggers. It comes with fully responsive design, live customizer, unlimited color options, etc.</desc>\n            <img>https://solwincdn-79e1.kxcdn.com/wp-content/uploads/2018/10/Bloggers-WordPress-Theme.png</img>\n            <link>https://www.solwininfotech.com/product/wordpress-themes/bloggers-lite/</link>\n        </bloggers_lite>\n        <probit>\n            <name>Probit</name>\n            <desc>Probit is a simple and easy to use free responsive WordPress theme that you can use for your blogging, showcasing a portfolio and your team or business websites in 30 minutes.</desc>\n            <img>https://solwincdn-79e1.kxcdn.com/wp-content/uploads/2015/09/probit.jpeg</img>\n            <link>https://www.solwininfotech.com/product/wordpress-themes/probit/</link>\n        </probit>\n        <twogether>\n            <name>TwoGether</name>\n            <desc>TwoGether is a simple, modern and free premium responsive WordPress wedding theme. It is perfect for wedding and life event invitation websites to showcase your wedding content in eye-catching way.</desc>\n            <img>https://solwincdn-79e1.kxcdn.com/wp-content/uploads/2015/10/Home-Page-With-Slider-370x370.png</img>\n            <link>https://www.solwininfotech.com/product/wordpress-themes/twogether-wedding-wordpress-theme/</link>\n        </twogether>\n        <veriyas>\n            <name>Veriyas</name>\n            <desc>Veriyas is a beautifull