INSERT INTO `wp_wfissues` VALUES (43,1557813537,1557813537,'new','wfUpgrade',75,'b4efdc145d23b0cbbfcea25656cdcd9d','b4efdc145d23b0cbbfcea25656cdcd9d','Your WordPress version is out of date','WordPress version 5.2 is now available. Please upgrade immediately to get the latest security updates from WordPress.','a:2:{s:14:\"currentVersion\";s:5:\"5.1.1\";s:10:\"newVersion\";s:3:\"5.2\";}'),(44,1557813537,1557813537,'new','wfPluginUpgrade',50,'caf6996c923f472d9cd13207bae76cef','caf6996c923f472d9cd13207bae76cef','The Plugin \"WP Migrate DB\" needs an upgrade (1.0.10 -> 1.0.11).','You need to upgrade \"WP Migrate DB\" to the newest version to ensure you have any security fixes the developer has released.','a:16:{s:4:\"Name\";s:13:\"WP Migrate DB\";s:9:\"PluginURI\";s:44:\"https://wordpress.org/plugins/wp-migrate-db/\";s:7:\"Version\";s:6:\"1.0.10\";s:11:\"Description\";s:235:\"Exports your database as a MySQL data dump (much like phpMyAdmin), does a find and replace on URLs and file paths, then allows you to save it to your computer. <cite>By <a href=\"https://deliciousbrains.com\">Delicious Brains</a>.</cite>\";s:6:\"Author\";s:58:\"<a href=\"https://deliciousbrains.com\">Delicious Brains</a>\";s:9:\"AuthorURI\";s:27:\"https://deliciousbrains.com\";s:10:\"TextDomain\";s:13:\"wp-migrate-db\";s:10:\"DomainPath\";s:11:\"/languages/\";s:7:\"Network\";b:1;s:5:\"Title\";s:72:\"<a href=\"https://wordpress.org/plugins/wp-migrate-db/\">WP Migrate DB</a>\";s:10:\"AuthorName\";s:16:\"Delicious Brains\";s:10:\"pluginFile\";s:80:\"/home/schadmin/public_html/wp/wp-content/plugins/wp-migrate-db/wp-migrate-db.php\";s:10:\"newVersion\";s:6:\"1.0.11\";s:4:\"slug\";s:13:\"wp-migrate-db\";s:5:\"wpURL\";s:43:\"https://wordpress.org/plugins/wp-migrate-db\";s:10:\"vulnerable\";b:0;}'),(45,1557813537,1557813537,'new','wfThemeUpgrade',50,'28e0a8a2a589f98d43612ea34aa0e480','28e0a8a2a589f98d43612ea34aa0e480','The Theme \"Twenty Nineteen\" needs an upgrade (1.3 -> 1.4).','You need to upgrade \"Twenty Nineteen\" to the newest version to ensure you have any security fixes the developer has released.','a:7:{s:10:\"newVersion\";s:3:\"1.4\";s:7:\"package\";s:60:\"https://downloads.wordpress.org/theme/twentynineteen.1.4.zip\";s:3:\"URL\";s:44:\"https://wordpress.org/themes/twentynineteen/\";s:4:\"Name\";s:15:\"Twenty Nineteen\";s:4:\"name\";s:15:\"Twenty Nineteen\";s:7:\"version\";s:3:\"1.3\";s:10:\"vulnerable\";b:0;}');
